#include "../sse.hpp"#include "../../vector.hpp"#include <iostream>#include <exception>int main(){	mat::Vector<float, 4> test1, test2 ; 	float *result = new (std::nothrow) float[4] ; 	std::cout << "Array allocated\n" ; 	test1[1] = 78.678f, test1[2] = 45.67f, test1[3] = 56.78f, test1[0] = -567.8f ; 	test2[1] = 89.78f, test2[2] = -67.001f, test2[3] = 6745.11f, test2[0] = 0.005f ; 	std::cout << "assigned\n" ; 	mat::sse2f ob1(test1.begin()), ob2(test2.begin()); 	std::cout << "Objects declared !\n" ; 	mat::sse2f ob3 = ob1 + ob2 ;  	std::cout << "Executed !\n" ; 	ob3 >> result ; 	std::cout << "loaded back !\n" ; 	std::cout << result[0] << " " << result[1] << " " << result[2] << " " << result[3] ; 	return 0; } 